  $("#appContent").append(data1);
  var stuData = $rootScope.studentData;

  var tenant = $rootScope.metadata.tenantid;
  $scope.initPay = function() {
    var url = $rootScope.BASE_URL + "/ctrnx?tenant=" + tenant;
    var data = {
      tenant: tenant,
      amount: $rootScope.totalFee,
      firstname: stuData.name,
      email: stuData.email,
      phone: stuData.mobile,
      en_no: stuData.enrollment_no,
      semester: stuData.semester,
      description: "Student Fee Payment"
    };

    if ($rootScope.feetype == "misc") {
      data.fee_for = "misc";
      data.fee_id = $rootScope.studentFee.fee_id;
    }
    //alert("dgg" + JSON.stringify($rootScope.user));
    if ($rootScope.user) {
      data.action_user = {
        id: $rootScope.user.user_id,
        email: $rootScope.user.email,
        name: $rootScope.user.name,
        college: $rootScope.user.college,
        roll: $rootScope.user.roll
      };
    }
    $http({
      url: url,
      data: data,
      method: 'POST'
    }).then(function(res) {
      var resData = res.data;
      if (resData.status == 'success') {
        $rootScope.trnxid = resData.data.trnxid;
        $rootScope.created_on = resData.data.created_on;
        launchInApp(resData.data.trnxid);
      } else {
        // show error
      }
    }, function(err) {
      // show error	
    });
  }

  var ref;

  function launchInApp(trnsId) {
    var url = $rootScope.BASE_URL + "/initpay?trnxid=" + trnsId;
    ref = window.open(url, '_blank', 'location=yes');
    ref.addEventListener('loadstop', loadStopCallBack);
    ref.addEventListener('exit', closeCallBack);
  }
  var pref;

  $scope.launchPortal = function() {
    var url = "http://lbccmsdu.org/default2.aspx?id=Ng==";
    pref = window.open(url, '_blank', 'location=yes');
    //pref.addEventListener('loadstop', loadStopCallBack);
    //ref.addEventListener('exit', closeCallBack);
  }
  $scope.nextPage = function() {

    $location.path("/app/Pay50/Pay50Page5")
  }
  var closeCallBack = function(data) {

    if (data.url.endsWith('success')) {
      window.location.href = "index.html#app/Pay50/Pay50Page5";
    } else if (data.url.endsWith('failure')) {
      window.location.href = "index.html#app/Pay50/Pay50Page7";
    }
  }
  var loadStopCallBack = function(data) {
      var nextPage = "/home";

      if (data.url.endsWith('success')) {
        $rootScope.studentData.status = "Paid";
        nextPage = "index.html#app/Pay50/Pay50Page5";
        ref.close();
        window.location.href = nextPage;

      } else if (data.url.endsWith('failure')) {
        nextPage = "index.html#app/Pay50/Pay50Page7";
        ref.close();
        window.location.href = nextPage;
      }

    }
    // ref.addEventListener('loadstart', loadStartCallBack);

  //ref.addEventListener('loadstop', loadStopCallBack);

  //ref.addEventListener('loaderror', loadErrorCallBack);
}

