    if ($scope.date == '' || $scope.month == '' || $scope.year == '') {
      navigator.notification.alert('Age cannot be blank.', null, '', 'Ok');
      return;
    }

    if ($scope.date < 1 || $scope.date > 31) {
      navigator.notification.alert('Invalid date.', null, '', 'Ok');
      return;
    }
    if ($scope.month < 1 || $scope.month > 12) {
