        if (err) {
          reject(err);
        } else {
          var rechargeResponse = $.xml2json($.parseXML(data.substring(1, data.length - 1)));
          if (rechargeResponse['ResponseCode'] == 0) {
            $rootScope.walletBalance = rechargeResponse['Balance'];
            resolve({
              "balance": true
            });
          } else {
            reject({
              "failed": true
            });
          }
        }
      });
    });
