  $rootScope.findOpKeyByRegionAlias = function(alias) {
    var opKeys = $rootScope.opKeys;
    for (var i = 0; i < opKeys.length; i++) {
      var op = opKeys[i];
      if (op.operatorAlias && op.operatorAlias.toUpperCase() == alias.toUpperCase()) {
        return op;
      }
    }
  };

  function rechargeMobileNow() {

    var txnId = 'TXNID' + new Date().getTime() + Math.round(Math.random() * 10000);

    var amount = $rootScope.recharge.amount * 100;
    var mobile = "91" + $rootScope.phone;

