    }
    var keyword = opKey.Keyword;
    var url = $rootScope.oxigenLoginEndpoint + "/OxigenService";
    var params = {
      "MobileNumber": mobile,
      "Amount": amount,
      "OTP": $scope.recharge.otp,
      "Keyword": keyword,
      "Servicenumber": $scope.recharge.mobileNo,
      "TransID": txnId
    };
    if ($scope.recharge.otp) {
      params.OTP = $scope.recharge.otp;
    }

    $rootScope.callApi("POST", params, url, (err, data) => {
      $rootScope.loadBlocker();
      if (err) {
        $rootScope.unloadBlocker();
        navigator.notification.alert('Something went wrong, please try again !', null, '', 'Ok');
